tables.table_schema:
CREATE TABLE filaments (
    id UUID PRIMARY KEY,
    material_name STRING,
    color STRING,
    quantity INT
);

CREATE TABLE resins (
    id UUID PRIMARY KEY,
    material_name STRING,
    color STRING,
    quantity INT
);

CREATE TABLE inventory (
  id INT PRIMARY KEY,
  item_id INT,
  item_type VARCHAR(50),
  quantity INT
);

CREATE TABLE printers (
    id INT PRIMARY KEY,
    model VARCHAR(255) NOT NULL,
    brand VARCHAR(50) NOT NULL,
    technology VARCHAR(50) NOT NULL
);
